	(22, 9, 'SAICAPACK', '977 585 500', '', '', '265M', '', '', '', 'Carrer de Cuzco, 30, 08030 Barcelona', 0, 'Lead', 'Catarina', 'Cliente de lista Excel, contacto web. La persona de contacto que había (Cristina Torres) ya no trabaja allí. La extensión que aparece en el excel da al departamento comercial y la persona con la que he hablado no me ha querido pasar con la sustituta de Cristina si no que le ha dado mis datos de contacto para que me llame. Como no sabía de la empresa les he dicho de entrar en la web. Con suerte me devuelven la llamada o piden DEMO a través de la web.  \r\nVeo en Linkedin Isidro Pacheco (Supply Chain manager) y otros de logística que probaré contactar la semana que viene', '2023-03-24 10:56:27', '2023-03-24 10:56:27', '', '', '', 'https://www.saica.com/es/saica-pack/', '', 0, '', '', '0', 0, 0),
