	(25, 9, 'Grupo CLH (Exolum)', '917 746 710', 'david.munoz@grupoclh.com', 'Logistica', '0,5M', '', '', '', '', 0, 'Rechazado', 'Excel Data Base', 'Hablado con David Muñoz el lunes 27.03.3023 \r\nNo recordaba Slotseyes pero dice haber resuelto su gestión de muelles con un software interno. ', '2023-03-27 10:41:05', '2023-06-14 13:17:58', '', '', '', 'https://exolum.com/', '', 0, '', '', '0', 0, 0),
	(26, 9, 'Disalfarm ', '935 860 278', 'lorena.vila@disalfarm.com', 'Logística', '2,5M', '', '', '', '', 0, 'Rechazado', 'Excel Data Base', 'Hablado con Lorena el 27.03.2023 Dice que al final contrataron Cardo Click y están contentos del resultado. ', '2023-03-27 10:52:23', '2023-06-14 13:17:41', '', '', '', 'https://www.disalfarm.com/', '', 0, '', '', '0', 0, 0),
	(27, 9, 'Dacsher', '', 'gonzalo.arevalo@es.dachser.com', 'Logística', '+7M', '', '', '', '', 0, 'Rechazado', 'Catarina - Excel Data Base', 'Gonzalo no recordaba Slotseyes pero explica que hace unos dos años estuvo mirando varios y ninguno le acabó de convencer así que con su departamento de IT han creado un software para su gestión y están cubiertos. Le mando nuestro contacto para posibles proyectos de futuro pues le explico que podríamos ayudar en cualquier desarrollo de software que necesiten.', '2023-03-28 12:59:50', '2023-06-26 13:13:19', '', '', '', 'https://www.dachser.es/', '', 0, '', '', '0', 0, 0),
